n_eligible_promotions":null,"id":"1344361268977656","comet_discussion_tab_cards":[{"__typename":"CometGroupDiscussionTabAboutCardRenderer","group":{"group_locations":[{"__typename":"Page","id":"374667879392046","name":"Kocmyrz\u00f3w-Luborzyca"}],"description_with_entities":{"text":"Witam w grupie mieszka\u0144c\u00f3w gminy Kocmyrz\u00f3w-Luborzyca, czyli bazie informacji i centrum komunikacji s\u0105siedzkiej. :) \ud83d\udeb8\ud83d\udeba\ud83d\udeb9\n\n\u2754Dlaczego powsta\u0142a grupa?\nW gminie przybywa nam nowych s\u0105siad\u00f3w, cz\u0119sto takich os\u00f3b, kt\u00f3re uciek\u0142y z miasta i chc\u0105 tutaj zapu\u015bci\u0107 korzenie. Chc\u0105 r\u00f3wnie\u017c zacz\u0105\u0107 uczestniczy\u0107 w \u017cyciu gminy, tutaj kupowa\u0107, korzysta\u0107 z us\u0142ug i wzajemnie si\u0119 wspiera\u0107.\n\n\u2757\u2757\u2757Warto wiedzie\u0107 np.\n\ud83d\udd39kt\u00f3re gospodarstwo oferuje mleko prosto od krowy, czy jajka od szcz\u0119\u015bliwych kur?\n\ud83d\udd39gdzie znale\u017a\u0107 fajn\u0105 kosmetyczk\u0119, kt\u00f3ra w domu zrobi paznokcie czy fryzjerk\u0119?\n\ud83d\udd39gdzie pos\u0142a\u0107 dzieci na angielski lub kt\u00f3re zaj\u0119cia s\u0105 warte uwagi?\n\ud83d\udd39gdzie mo\u017cna po\u0107wiczy\u0107 albo nawet um\u00f3wi\u0107 si\u0119 na wsp\u00f3lne bieganie?\n\ud83d\udd39kto robi torty na zam\u00f3wienie lub drobne poprawki krawieckie?\n\ud83d\udd39kto prowadzi na miejscu ksi\u0119gowo\u015b\u0107 dla ma\u0142ych firm?\n\nTo tylko niekt\u00f3re pytania, kt\u00f3re ciekawi\u0105 mieszka\u0144c\u00f3w. Bo kto powiedzia\u0142, \u017ce tutaj nic nie ma i trzeba je\u017adzi\u0107 do Krakowa?\n\nInformujmy si\u0119 r\u00f3wnie\u017c o:\n\ud83d\udd38wydarzeniach wszelkiego rodzaju (festyny, warsztaty, badania lekarskie...)\n\ud83d\udd38nowootwartych sklepach i us\u0142ugach\n\ud83d\udd38dostawcach us\u0142ug i towar\u00f3w na terenie gminy \n\nZapraszam lokalne firmy i osoby indywidualne do przedstawienia swojej oferty, informowania spo\u0142eczno\u015bci o promocjach.\n\n\ud83d\udd06Masz pomys\u0142 na jakie\u015b wydarzenie, projekt? \ud83d\udccbMo\u017ce w tej grupie znajdziesz osoby, kt\u00f3re b\u0119d\u0105 chcia\u0142y w\u0142\u0105czy\u0107 si\u0119 w organizacj\u0119?\n\nPodoba Ci si\u0119 nasza grupa? Zapro\u015b do niej swoj\u0105 rodzin\u0119, znajomych, kt\u00f3rzy mieszkaj\u0105 w gminie Kocmyrz\u00f3w-Luborzyca. Grupa jest \"prywatna\", co oznacza \u017ce tylko cz\u0142onkowie grupy widz\u0105 posty i mog\u0105 dodawa\u0107 swoj\u0105 tre\u015b\u0107. \n\nKoniecznie przeczytaj regu\u0142y grupy.","delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[],"color_ranges":[]},"privacy_info":{"description":{"delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[],"color_ranges":[],"text":"Tylko cz\u0142onkowie grupy mog\u0105 sprawdzi\u0107 list\u0119 cz\u0142onk\u00f3w grupy i zobaczy\u0107 ich posty."},"label":{"text":"Prywatna"},"icon_name":"privacy"},"discoverability_info":{"label":{"text":"Widoczna"},"icon_name":"eye","description":{"delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[],"color_ranges":[],"text":"Ka\u017cdy mo\u017ce znale\u017a\u0107 t\u0119 grup\u0119."}},"linked_games":[],"if_viewer_can_see_admin_autonomy_about_info":null,"if_viewer_can_see_admin_left_hand_rail":null,"id":"1344361268977656"},"__module_operation_GroupsCometFeedSecondaryColumn_cometDiscussionTabCards":{"__dr":"GroupsCometAboutRHCCardRenderer_cardRenderer$normalization.graphql"},"__module_component_GroupsCometFeedSecondaryColumn_cometDiscussionTabCards":{"__dr":"GroupsCometAboutRHCCardRenderer.react"}},{"__typename":"CometGroupDiscussionTabUpcomingEventsCardRenderer","group":{"if_viewer_can_see_admin_left_hand_rail":null,"id":"1344361268977656","group_address":"","all_group_events":{"edges":[{"node":{"url":"https:\/\/www.facebook.com\/events\/184204731414969\/","profile_picture":{
